import AdminMenu from '../adminmenu/AdminMenu';
import './addblog.css';

export class AddBlog extends Component {
  render() {
    return (
      <div className='addblog'>
        <AdminMenu />
        <form  onSubmit={e => e.preventDefault()}>
            <label>
                Title:
            </label>
            <input type="text" style={{ borderStyle: 'solid',
    border: '1px'}}/>
            <label>
                Body:
            </label>
            <input type="text"/>
            <input type="submit"/>
        </form>
      </div>
    )
  }
}

export default AddBlog;
